import { fromJS } from "immutable";

const defaultState = fromJS({
  topicItem: [
  ],
  articleList: [
    
  ],
  RecommendList: [
    {
      id: 1,
      imgUrl:
        "https://img.51miz.com/Element/00/59/35/05/13007b36_E593505_56abf61c.jpg",
    },
    {
      id: 2,
      imgUrl:
        "https://lh3.googleusercontent.com/proxy/Kbo2H1J9Pjg9yysWk8FHNReMGBR-Y7vqsKQE4RdRX0ev22oiHz20jSv3aJzRjZoN4h9lNRAdRo0v_BiHdXz75A0lSR2V4wAa8dA6Cck9p8kf2g",
    },
  ],
});

export default (state = defaultState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};
